import React from 'react';
import './Contact.css';

const name = 'T-800';
const online = true;


function Contact(props){
    return(
        <div className="Contact">

            <img className="avatar" src={props.avatar} alt={props.nickname + "avatar"}/>

            <div className="status">
                <p className="name">{props.nicknamename}</p>
                <div className="status">
                    {online ? <div className="status-online"> <p >{props.online}</p></div> 
                    :
                    <div className="status-offline"> <p>{props.offline}</p></div>}
                </div>
            </div>


        </div>
    )
}

export default Contact;

